const BookCover = ({ imageLinks }) => {
    const imageUrl = (imageLinks && (imageLinks.smallThumbnail || imageLinks.thumbnail));
    const backgroundImage = imageUrl && `url("${imageUrl}")` || 'none';

    return (
        <div
            className="book-cover"
            style={{ width: 128, height: 193, backgroundImage: {backgroundImage} }} />);
}

export default BookCover;
